import React, { useState } from 'react';
import axios from 'axios';
import styles from './SuperAdminReports.module.css';

const Reports = () => {
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [reportData, setReportData] = useState([]);

  const fetchReport = () => {
    if (!startDate || !endDate) {
      alert('Please select both dates');
      return;
    }

    axios.get(`/api/superadmin/reports?startDate=${startDate}&endDate=${endDate}`)
      .then(res => setReportData(res.data))
      .catch(err => console.error(err));
  };

  return (
    <div className={styles.reportsContainer}>
      <h2>Service Request Reports</h2>

      <div className={styles.dateInputs}>
        <label>
          Start Date:
          <input type="date" value={startDate} onChange={e => setStartDate(e.target.value)} />
        </label>
        <label>
          End Date:
          <input type="date" value={endDate} onChange={e => setEndDate(e.target.value)} />
        </label>
        <button onClick={fetchReport}>Generate Report</button>
      </div>

      {reportData.length > 0 && (
        <div className={styles.reportTable}>
          <h3>Requests from {startDate} to {endDate}</h3>
          <table>
            <thead>
              <tr>
                <th>Request ID</th>
                <th>Service</th>
                <th>User</th>
                <th>Status</th>
                <th>Created On</th>
              </tr>
            </thead>
            <tbody>
              {reportData.map((req) => (
                <tr key={req.requestId}>
                  <td>{req.requestId}</td>
                  <td>{req.serviceName}</td>
                  <td>{req.userName}</td>
                  <td>{req.status}</td>
                  <td>{req.createDate}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default Reports;
